import React from "react";

export default function Footer () {
    return (
        <footer className="footer">
            <a className="footer-text" href="https://www.linkedin.com/in/jack-carpenter-3b256421b/" target="">LinkedIn</a> 
            <a className="footer-text" href="https://github.com/Jcarps97" target="">Github</a>
            <a className="footer-text" href="https://my.indeed.com/resume?hl=en&co=US&from=gnav-homepage&_ga=2.10496628.1120774440.1637360348-518049747.1637360348">Indeed</a>
        </footer>
    );
};
